import React, {Component} from 'react';
import {connect} from 'react-redux'

import { Card, CardHeader, CardBody, CardTitle, Row, Col } from "reactstrap";
import kelas from './Login.css';
import FormInputs from '../../components/FormInputs/FormInputs';
import Button from "../../components/CustomButton/CustomButton.jsx";
// import classes from '*.module.sass';

// Auth
import * as actions from '../../store/action/index';


class Login extends Component {

    submitHandler = (event) => {
        event.preventDefault();
        this.props.onAuth(this.state.control.email.value,this.state.control.password.value);

    };

    render() {
        return(
            <div>
                <div style={{background:'grey', position:'absolute', width:'100%', height:'100%'}}></div>      
                    <Col md={4} style={{margin:'auto',paddingTop:'100px'}}>
                        <Card className="card-user text-center">
                        <CardHeader>
                            <CardTitle tag="h4">Log In</CardTitle>
                        </CardHeader>
                        <CardBody>
                            <form onSubmit={this.submitHandler}>
                                <FormInputs className={kelas.center}
                                    ncols={["col-md-12"]}
                                    proprieties={[
                                      {
                                        label: "E-Mail Admin Account",
                                        inputProps: {
                                          type: "email",
                                          placeholder: "E-mail",
                                          center:"true"                                       
                                        }
                                      }
                                    ]}
                                />
                                <Row>
                                    <div className="update ml-auto mr-auto">
                                    <Button color="primary" round>Enter</Button>
                                    </div>
                                </Row>
                            </form>
                        </CardBody>                                                
                        </Card>
                    </Col>                 
            </div>
        )
    }
}

const mapDispatchToProps = dispatch => {
    return {
        onAuth: (email,password) => dispatch(actions.auth(email, password))
    }
}

export default connect(null,mapDispatchToProps)(Login);
